import CalendarItem from './CalendarItem'
import React from "react"

class DeleteCalendarItem extends React.Component{


    buttonClickDelete(){
        //remove the item entry from the state

    }

    buttonClickCancel(){
        //do nothing, close the window
    }

    constructor(){
        this.buttonClickDelete = this.buttonClickDelete.bind(this);
        this.buttonClickCancel = this.buttonClickCancel.bind(this);

    }



render(){
    let btnDelete = <button className="ActionButton" onClick={this.buttonClickDelete}>Delete</button>
    let btnCancel = <button className="ActionButton" onClick={this.close()}>Cancel</button>

    return(
    <div>
        <CalendarItem/>
        {btnDelete}
        {btnCancel}
    </div>
    );
}

}
export default DeleteCalendarItem;
